      try {
        const data = await axios.get<HostsData[]>(

          `https://my-json-server.typicode.com/sakthi-vunet/dummyhostsnew/list`
        );

        setData(data.data);
      } catch (e) {
        console.log(e);
      }
    };
  React.useEffect(() => {
      getProductData();
  }, []);

  console.log("landing page");
